                "sentence":"The Polish physician Ludwik Rajchman is widely regarded as the founder of UNICEF and served as its first chairman from 1946 to 1950 , when he had to flee the United States in the wake of McCarthyism . Rajchman is to this day the only person who served as UNICEF 's Chairman for longer than 2 years . On Rajchman 's suggestion , the American Maurice Pate was appointed first executive director , serving from 1947 until his death in 1965 . In 1950 , UNICEF 's mandate was extended to address the long-term needs of children and women in developing countries everywhere .",
