                "sentence":"The national committees raise funds from the public sector . UNICEF is funded entirely by voluntary contributions , and the National Committees collectively raise around one-third of UNICEF 's annual income . In the United States , Nepal and some other countries , UNICEF is known for its `` Trick-Or-Treat for UNICEF '' program in which children collect money for UNICEF from the houses they trick-or-treat on Halloween night , sometimes instead of candy . UNICEF is present in 191 countries and territories around the world , but not involved in nine others ( Bahamas , Brunei , Cyprus , Latvia , Liechtenstein , Malta , Mauritius , Monaco , Singapore , and Taiwan ) .",
