                "sentence":"This has led UNICEF to be skeptical of international adoption efforts as a solution to child care problems in developing countries ; UNICEF has preferred to see children cared for in their birth countries rather than be adopted by foreign parents . A 2015 article in `` US News & World Report `` magazine asserted UNICEF 's intervention that on giving large cash payments to developing countries can lead to a cessation of international adoptions until all of its recommendations are in place , and have even labeled UNICEF a `` villain '' for the extent of its negative impact on orphans . Elizabeth Bartholet and Paulo Barrozo have written in this context , encouraging adoption protocols to take on a more child-centric viewpoint . In 2005 , Richard Horton editor-in-chief of `` The Lancet `` , editorialized that `` over 60 % of these deaths were and remain preventable '' and that the coverage levels for these interventions are `` appallingly low in the 42 countries that account for 90 % of child deaths '' .",
